      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu lausen begehrt",
      "text": "1. Es sucht jemand einen freien Schreibbursch mit aller Zogefertigkeit und klöner Fison, der Liebbhaber in im Bereich auf erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu lausen begehrt",
      "text": "2. Man begehrt eine Churte mit 4 Mädeln in et main 3 Bübgen und et einem Breed samt geberigen Gärber, der Liebbaber in im Bereich auf erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu lausen begehrt",
      "text": "3. Es wird der Land nach netten Red her Bräutigam Dünnemois su verlaunet hat, tan im Bereich einen Raifer darauf pernehmen, wie auch in einem mittelmäßigen Evention, so ehrenhaft begert wird, beide ohne Entgeld im Bereich auf erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu lausen begehrt",
      "text": "4. Es sucht jemand eine ante, folde und ungebe eine Saum halbe Feurerbrigen zum fragen oder zum fabren, der Liebbaber in im Bereich auf erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu lausen begehrt",
      "text": "5. Es sucht jemand einen mittelmäßigen Fronleichnam mit 8 Luchsdien, der Liebbaber in im Bereich auf erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu lausen begehrt",
      "text": "6. Es verlangt jemand eine nicht gar große eine Seile-Lappa gar taufen, der Liebbaber in im Bereich auf erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu lausen begehrt",
      "text": "7. Es verlangt jemand einen glatten ungesäumten gebrochener Kofen, der Liebbaber in im Bereich auf erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Hingegen wird zu lausen begehrt",
      "text": "8. Man verlangt einen noch guten Rachel-Ofen mitlermaßiger Größe mit über eine guth, der Liebbaber in im Bereich auf erfragen; letzet aber einen Bergung."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausreihen offeriert",
      "text": "1. Ein Poßment mitten im Offenburger Hof, wo die Augentrichin idgen wird, aus nächste Feinacht-oder Winach-Fronfallen in bebehen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausreihen offeriert",
      "text": "2. Ein-haußes Poßment an der Espalen von eter Etuben und Reckentamniter, oder nach Dichen zwei Kammern samt einem betten Commercius, auch auf einem Hoben, und nach Helben Stauning und Heublüthe, aus Phagitz Fronfallen zu bebehen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausreihen offeriert",
      "text": "3. Ein Poßment mit einem schönen Garten und einem großen Saal, Kammern, Küchin, Keller, Maß zum Hofs, Sutitt zum Bauchhaus, und so bete hg, einem Garten in der Bereicher Vorstadt, im Bereich auf erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausreihen offeriert",
      "text": "4. Ein groß doppelter Bruch: Esbichte aus E. E. Bereich auf Hohen Rupf."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausreihen offeriert",
      "text": "5. Bis den einen wird eine fidibunde Hündin begert, um etliche junger Hunde zu aufserte, die sich gegen curre Erkanntlichkeit, wo ich auch meinen, im Bereich ohne Entgeld zu pernemen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Es wird zum Ausreihen offeriert",
      "text": "9. Hat durchge Beybnacht if unter der Et. Defters-Schult ein gezäumtiger Magazin in bebehen, horum if in bem Spilgund augen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Kost, Information und Bedientis gen werden augetragen und begehrt",
      "text": "1. An ein modereß prothelantisches Haus in denen Niederlanden mit ein Candidatus Theologie, der nach oben auch die französche Erzech werlunde, su einen Haus-Dyrckter begert, weßbald if im Bereich auf erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Kost, Information und Bedientis gen werden augetragen und begehrt",
      "text": "2. Man verlaunet eine Blenchten in ete Fabrike, der if ich in elicher Haus-Gelegenheiten betreffen lebe, im Bereich auf erfragen."
    },
    {
      "date": "1731-01-02",
      "tags_section": "Kost, Information und Bedientis gen werden augetragen und begehrt",
      "text": "3. Man sucht einen Estalntich in ein Births-Haus, im Bereich auf erfragen."
    }
  ]
}
